import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <React.Fragment>
      <Switch>
      <Route exact path='/movies' render={() => {
              return <Home movies={this.state.movies}></Home>
            }} />
      </Switch>
    </React.Fragment>
  );
}

export default App;
